import React from 'react';

import './BoardCard.scss';

import googleImage from '../../img/google.jpg';

interface Props {
    imgUrl: string;
    boardTitle: string;
    todos: number;
}

const BoardCard = (): JSX.Element => {
    return (
        <div className="boardcard">
            <img className="boardcard__image" alt="" src={googleImage}></img>
            <div className="boardcard__info">
                <div className="boardcard__title">BOARD 1</div>
                <div className="boardcard__todos-total">67 Active Tasks</div>
            </div>
        </div>
    );
}

export default BoardCard;
